    <p>{`RedisInsight profiler analyzes your Redis commands that are being run on the Redis server in real-time. The tool provides you detailed  information about the number of commands processed, commands/second and number of connected clients. It also gives information about top prefixes, top keys and top commands. `}</p>
    <p>{`It basically runs the Redis MONITOR command and generates a summarized view. MONITOR is a debugging command that streams back every command processed by the Redis server. It can help in understanding what is happening to the database. This command can both be used via `}<inlineCode parentName="p">{`redis-cli`}</inlineCode>{` and via `}<inlineCode parentName="p">{`telnet`}</inlineCode>{`.All the commands sent to the redis instance are monitored for the duration of the profiling. The ability to see all the requests processed by the server is useful in order to spot bugs in an application both when using Redis as a database and as a distributed caching system.`}</p>
    <div {...{
      "className": "admonition admonition-important alert alert--info"
    }}><div parentName="div" {...{
        "className": "admonition-heading"
      }}><h5 parentName="div"><span parentName="h5" {...{
            "className": "admonition-icon"
          }}><svg parentName="span" {...{
              "xmlns": "http://www.w3.org/2000/svg",
              "width": "14",
              "height": "16",
              "viewBox": "0 0 14 16"
            }}><path parentName="svg" {...{
                "fillRule": "evenodd",
                "d": "M7 2.3c3.14 0 5.7 2.56 5.7 5.7s-2.56 5.7-5.7 5.7A5.71 5.71 0 0 1 1.3 8c0-3.14 2.56-5.7 5.7-5.7zM7 1C3.14 1 0 4.14 0 8s3.14 7 7 7 7-3.14 7-7-3.14-7-7-7zm1 3H6v5h2V4zm0 6H6v2h2v-2z"
              }}></path></svg></span>{`important`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`Because MONITOR streams back all commands, its use comes at a cost.Running monitor command is dangerous to the performance of your production server, hence the profiler is run for a maximum time of 5 minutes, if the user has not stopped it in between. This is to avoid overload on the Redis server.`}</p></div></div>
    <p>{`Follow the below instructions to test drive RedisInsight profiler tool:`}</p>
    <h2 {...{
      "id": "step-1--create-redis-database-with-redistimeseries-module-enabled"
    }}>{`Step 1.  Create Redis database with RedisTimeSeries module enabled`}</h2>
