    <h2 {...{
      "id": "step-5-accessing-the-redistimeseries-keys"
    }}>{`Step 5: Accessing the RedisTimeSeries Keys`}</h2>
    <p><a parentName="p" {...{
        "href": "https://developer.redislabs.com/explore/redisinsight/getting-started"
      }}>{`Follow these steps to connect to the database`}</a>{` using RedisInsight. Once you are connected to RedisInsight GUI, you can verify the 3 RedisTimeSeries keys:`}</p>
